import React from "react";

export const bootstrapTitles = {
    h1: props => <h1 {...props}></h1>,
    h2: props => <h2 {...props}></h2>,
    h3: props => <h3 {...props}></h3>,
    h4: props => <h4 {...props}></h4>,
    h5: props => <h5 {...props}></h5>,
    h6: props => <h6 {...props}></h6>
}
